INSERT INTO dreams_idioma VALUES(1,'¿How was your dream?','Unpleasant dream','Pleasant Dream','CONTINUE','YES, CANCEL','YES, CONTINUE','You just indicated
that your Dream was Unpleasant','You just indicated
that your Dream was Nice','Focus on a precise moment of a recent dream and indicate if it was pleasant or unpleasant.',1,'Add characters','Example: * Objects * Groups * Places * Parts of the body * Events * Animals * People, etc.','Dreams are a quick way to access our inner world. The elements and characters present in them are aspects of our personality','P1 and P2 are actually facets of you; what they experience, what they feel and the way they are considered, show the relationship you have with yourself.','To reach fullness it is important to start by becoming aware of these ways of being, acting and / or feeling manifested in your dreams.','* Mechanism by which we attribute our own aspects to others','What was the Unpleasantness of the dream?','The unpleasantness of the dream was ...','Online','Now you are','The pleasantness of the dream was','What was the Pleasant of the dream?','What were the characters or fundamental elements in the pleasant situation?','Hello, p1 How are you? I know little about you please describe','Good to know you p1 I would like you to tell me what you think about p2','Hi, p2 How are you? I know little about you please describe','Good to know p2 I would like you to tell me what you think about p1','Hello p1, p2 wants to meet you.','Hi p2, p1 wants to meet you.','It will result in many websites that use this text if they are in a state of development. Many versions have evolved over the years, sometimes by accident, other times on purpose','It will result in many websites that use this text if they are in a state of development. Many versions have evolved over the years, sometimes by accident, other times on purpose','Continue as p1','Continue as p2','p1 It says:','Fine','Bad','So so','To write...','help2','help3','help4','help5','help6','help7','help8','Hello p1, how are you','p2 It says:','good luck','hi','bye','Add nice characters','Add unpleasant characters','Character 1','Character 2','Log Out','Create a dream','Languages','My dreams','Dreams','# three','# four','# five','# six','# seven','Hello, p1 How are you? I know little about you please describe :D','Good to know you p1 I would like you to tell me what you think about p2 :D','Hi, p2 How are you? I know little about you please describe :D','Good to know p2 I would like you to tell me what you think about p1 :D','Hello p1, p2 wants to meet you. :D','Hi p2, p1 wants to meet you. :D');
INSERT INTO dreams_idioma VALUES(2,'¿Qué tan agradable o desagradable fue tu sueño?','Sueño Desagradable','Sueño Agradable','CONTINUAR','NO, CANCELAR','SI, CONTINUAR','Acabas de indicar
que tu Sueño fue Desagradable','Acabas de indicar
que tu Sueño fue Agradable','Enfócate en un momento preciso de un sueño reciente e indica qué tan agradable o desagradable fue',2,'Agregar personajes','Ejemplo: *Objetos *Grupos *Lugares *Partes del cuerpo *Eventos *Animales *Personas, etc.','Los elementos y personajes presentes en los sueños son aspectos de nuestra personalidad manifestados por nuestra psiquis mediante un lenguaje simbólico. p1 y p2 son facetas tuyas que se encuentran en conflicto / proceso de reconciliación','p1 y p2 representan facetas tuyas; lo que experimentan, lo que sienten y la forma en la que los consideras evidencian la relación que tienes contigo mism@.','Los sueños son una vía de acceso a nuestro mundo interior. Los elementos y personajes presentes en ellos son aspectos de nuestra personalidad que nuestra psiquis manifiesta mediante un lenguaje simbólico, a modo de proyecciones*.

Para alcanzar la plenitud es importante hacer consciencia de estas formas de ser, actuar y/o de sentir.

*Mecanismo mediante el cual le atribuimos aspectos propios a otros

*Proyectamos como algo externo aquello que no reconocemos como propio','*Un personaje que oprime, agrede o límita intencionalmente representa un saboteador o crítico interno','¿Qué fue lo Desagradable del sueño? Enfócate en un sólo momento','Lo desagradable en ese momento del sueño fue que...','en línea','Ahora eres','Lo agradable de ese momento del sueño fue que...','¿Qué fue lo Desagradable del sueño? Enfócate en un sólo momento','¿Cuales fueron los 2 personajes o elementos fundamentales en la situación agradable?','Hola p1, que gusto conocerte! Sé poco sobre ti, por favor describe aquello por lo que te caracterizas en condiciones normales','Que bueno conocerte p1. Me gustaría que me cuentes qué piensas de p2 en el sueño','Hola p2, es un placer que hablemos! Cuéntame qué te caracteriza en condiciones normales, así podré conocerte mejor','Que bueno conocerte p2. Me gustaría que me dijeras que piensas de p1 en el sueño','Hola p1, p2 desea hablar contigo. Espero que logren expresar con honestidad todo aquello que hace falta. Buena suerte!','Hola p2, por favor continúa la conversación con p1 hasta que ambos logren reconocerse como aspectos en la personalidad de quién los soñó','Cierra los ojos, respira profunda y lentamente concentrándote en las sensaciones que P1 está(n) experimentando como parte del sueño. 

Continúa cuando hayas logrado ponerte en su lugar y estés list@ para reaccionar como si fueras p1','Cierra los ojos, respira lentamente concentrándote en las sensaciones que P2 está experimentando como parte del sueño.

Presiona continuar cuando hayas logrado ponerte en su lugar y estés list@ para reaccionar como si fueras p2','Continuar como p1','Continuar como p2','p1 Dice:','Pienso igual. Tengo cosas que decirte','No sé de que podamos hablar','No me agrada hacerlo pero sé que es necesario...','Responder...','ayuda2
Bueno, pero primero dime: ¿qué te agrada de mi?
Ok, pero antes quiero saber qué te desagrada de mi','ayuda3','ayuda4','ayuda5','ayuda6','ayuda7','Termina la conversación cuando ambos personajes hayan compartido 1. Cómo se sienten en el sueño, 2. Aquello que les agrada o desagrada del otro. (Si hay alguien oprimido, intenta que venza)','Hola p1. Es bueno tener esta oportunidad de hablar','NULO:Seamos honestos y expresmos cómo nos sentimos','Está bien. Inicia tú. ¿Cómo te sientes y por qué?','Ok, pero primero ¿qué te agrada o desagrada de mi?','Bueno, pero antes dime qué deseas de mi parte','Agrega los personajes agradables','Agrega los personajes desagradables','Personaje 1','Personaje 2','Cerrar Sesion','Crear un sueño','Idiomas','Mis sueños','Sueños','Ahora ponte en el lugar de p1. Expresa desde su punto de vista lo que piensa y siente en relación con P2','Ahora ponte en el lugar de p2. Expresa desde su punto de vista lo que piensa y siente en relación con P1','Reacciona como si fueras p1, intentando hacer consciencia de la faceta de tu personalidad que está representando','Contéstale a p1 como p2, haciendo consciencia de que ambos son aspectos de tu personalidad. Continúa hasta que hayan compartido lo qué les agrada o desagrada del otro.','Ahora eres p1. Finaliza la conversación cuando ambas facetas de tu personalidad hayan logrado expresar: 

1. Cómo se sienten en el sueño
2. Aquello que les agrada o desagrada del otro.','Hola p1, que gusto conocerte! Sé poco sobre ti, por favor describe aquello por lo que te caracterizas en condiciones normales :D','Que bueno conocerte p1. Me gustaría que me cuentes qué piensas de p1 en el sueño :D','Hola p2, es un placer que hablemos! Cuéntame qué te caracteriza en condiciones normales, así podré conocerte mejor :D','Que bueno conocerte p2. Me gustaría que me dijeras que piensas de p1 en el sueño :D','Hola p1, p2 desea hablar contigo. Espero que logren expresar con honestidad todo aquello que hace falta. Buena suerte! :D','Hola p2, por favor continúa la conversación con p1 hasta que ambos logren reconocerse como aspectos en la personalidad de quién los soñó :D');
INSERT INTO dreams_idioma VALUES(3,'¿Comment était ton rêve?','Rêve désagréable','Rêve agréable','CONTINUER','OUI, ANNULER','OUI, CONTINUER','Vous venez d''indiquer
que votre rêve était désagréable','Vous venez d''indiquer
que ton rêve était bien','Concentrez-vous sur un moment précis d''un rêve récent et indiquez s''il était plaisant ou désagréable.',3,'Ajouter un caractère','Exemple: * Objets * Groupes * Lieux * Parties du corps * Évé','Les rêves sont un moyen rapide d''accéder à notre monde intérieur. Les éléments et les caractères présents en eux sont des aspects de notre personnalité représentés par notre "Psyché" à travers une lan','P1 et P2 sont en réalité des facettes de vous; Ce qu''ils ressentent, ce qu''ils ressentent et la manière dont ils sont considérés montrent la relation que vous entretenez avec vous-même.','Pour atteindre la plénitude, il est important de commencer par prendre conscience de ces manières d''être, d''agir et / ou de se manifester dans vos rêves.','* Mécanisme par lequel nous attribuons nos propres aspects aux autres','Les rêves sont un moyen rapide d''accéder à notre monde intérieur. Les éléments et les caractères présents en eux sont des aspects de notre personnalité représentés par notre "Psyché" à travers une lan','Pour atteindre la plénitude, il est important de commencer par prendre conscience des manières d''être, d''agir ou de ressentir qui se manifestent comme des projections dans nos rêves.','* Mécanisme à travers lequel nous attribuons nos propres aspects aux autres.','Commençons - Fermez les yeux','L''agrément du rêve était','Quel était le Pleasant du rêve?','Quels étaient les caractères ou les éléments fonda','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
